import React, { Component } from "react";
import "./index.css";
export default class GameModel extends Component {
  render() {
    return (
      <div>
        <div class="game-model-header">
          {/* <span> Congratulations</span> */}
          <span> Fall , Try Again </span>
        </div>
        <div class="game-model-img">
          <img
            src="https://image.freepik.com/free-vector/trophie_53876-25485.jpg"
            alt="Winner Image"
          />
        </div>
        <div class="game-model-buttons">
          <button>Play Again</button>
          <button>Cancel</button>
        </div>
      </div>
    );
  }
}
